webpackJsonp([0xb822dc19bdad7000],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-insert-query.json":function(t,n){t.exports={data:{markdownRemark:{html:'<h2>SQL Insert Query</h2>\n<p>Insert queries are a way to insert data into a table. Lets say we have created a table using</p>\n<p><code>CREATE TABLE example_table ( name varchar(255), age int)</code></p>\n<p><strong>example_table</strong></p>\n<table>\n<thead>\n<tr>\n<th>Name</th>\n<th>Age</th>\n</tr>\n</thead>\n<tbody>\n</tbody>\n</table>\n<p>Now to add some data to this table , we’ll use <strong>INSERT</strong> in the following way:</p>\n<p><code>INSERT INTO example_table (column1,column2) VALUES ("Andrew",23)</code></p>\n<p><strong>example_table</strong></p>\n<table>\n<thead>\n<tr>\n<th>Name</th>\n<th>Age</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Andrew</td>\n<td>23</td>\n</tr>\n</tbody>\n</table>\n<p>Even the following will work but it’s always a good practice to specify which data is going into which column.</p>\n<p><code>INSERT INTO table_name VALUES ("John", 28)</code></p>\n<p><strong>example_table</strong></p>\n<table>\n<thead>\n<tr>\n<th>Name</th>\n<th>Age</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Andrew</td>\n<td>23</td>\n</tr>\n<tr>\n<td>John</td>\n<td>28</td>\n</tr>\n</tbody>\n</table>',fields:{slug:"/sql/sql-insert-query/"},frontmatter:{title:"SQL Insert Query"}}},pathContext:{slug:"/sql/sql-insert-query/"}}}});
